import { Route, Switch } from "react-router-dom";
import Headerbar from "./components/layouts/Headerbar";
import Postad from "./components/Postad";

function App() {
  return (
    <div>
      <header>
      <Headerbar />
      <Switch>
        <Route path='/post-ad' exact>
          <Postad />
        </Route>
      </Switch>
      </header>
    </div>

  );
}

export default App;
